let ranOnce = false;

export default function PoweredByRojifi(
    text = 'Visit https://rojifi.com for advanced financial solutions.',
    header = true,
    force = false
) {
    if (!force && ranOnce) return;

    // Base64 encoded logo - paste your base64 string here
    const logoUrl = `data:image/png;base64,`;

    const use = {
        line: !!text,
        logo: [
            /Safari/.test(navigator.userAgent) && /Apple Comp/.test(navigator.vendor),
            /Chrome/.test(navigator.userAgent) && /Google Inc/.test(navigator.vendor),
        ],
    };

    const css = {
        head: `
            color: #3B82F6;
            font-size: 22px;
        `,
        logo: `
            font-size: 45px;
            padding: 0 0 0 0;
            background: url(${logoUrl}) no-repeat center center;
            background-size: contain;
            width: 200px;
            height: 92px;
            display: inline-block;
            margin-right: 12px;
        `,
    };

    const log = {
        S: '%cPowered by %cRojifi',
        C: [css.head, `${css.head}; font-weight: 900;`],
        logo: {
            S: '%c %c',
            C: [css.logo, ''],
        },
        line: {
            S: `%c\n${text}\n `,
            C: ['color: #3B82F6; font-style: italic'],
        },
    };

    if (!header) {
        log.S = '';
        log.C = [];
    } else if (use.logo.indexOf(true) >= 0) {
        log.S = `${log.logo.S}${log.S}`;
        log.C.unshift(...log.logo.C);
    }

    if (use.line) {
        log.S += log.line.S;
        log.C.push(...log.line.C);
    }

    // Clear console and immediately log our message
    console.clear();
    console.log(`\n${log.S}`, ...log.C);

    ranOnce = true;
}